import SignUpForm from "../../components/sign-up-form/sign-up.component";
import { SignIn } from "../../components/sign-in-google/sign-in-google.component.jsx";
import { SignInForm } from "../../components/sign-in-form/sign-in-form.component";

const inputs = [
  {
    label: "Display Name",
    name: "displayName",
    type: "text",
    key: 1,
  },
  {
    label: "Email",
    name: "email",
    type: "email",
    key: 2,
  },
  {
    label: "Password",
    name: "password",
    type: "password",
    key: 3,
  },
  {
    label: "Confirm Password",
    name: "confirmPassword",
    type: "password",
    key: 4,
  },
];

export const Authentication = () => {
  return (
    <div>
      <div>
        <SignInForm
          inputFields={[
            { label: email, key: 1, type: "email", name: "email" },
            { label: "Password", key: 2, type: "password", name: "password" },
          ]}
        />
      </div>
      <div>
        <SignIn />
      </div>
      <div>
        <SignUpForm inputFields={inputs} />
      </div>
    </div>
  );
};
